Name: Term-Preterm EHG Database
Description: The Electrohysterogram records (uterine EMG records) included in the
  Term-Preterm ElectroHysteroGram DataBase (TPEHG DB) were obtained from 1997 to 2005
  at the University Medical Centre Ljubljana, Department of Obstetrics and Gynecology.
  The records were obtained during regular check-ups either around the 22nd week of
  gestation or around the 32nd week of gestation.
Documentation: https://doi.org/10.13026/C2FW2V
